/* eslint-disable react/jsx-no-comment-textnodes */
import React from "react";
import "./../Page.css";

import { IonBackButton, IonCard, IonInput, IonItem, IonLabel, IonList, IonListHeader, IonRow } from "@ionic/react";
import { IonButtons, IonContent, IonHeader, IonTitle, IonToolbar } from "@ionic/react";
const ProductAdd: React.FC = () => {
  return (
    <>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton></IonBackButton>
          </IonButtons>
          <IonTitle>Productos</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonCard>
          <IonList inset={true}>
            <IonListHeader color={"primary"}>
              <IonLabel>Listado de Productos</IonLabel>
            </IonListHeader>
            <IonRow>
              <IonItem>
                <IonLabel>Input with placeholder</IonLabel>
                <IonInput placeholder="Enter company name"></IonInput>
              </IonItem>
            </IonRow>
          </IonList>
        </IonCard>
      </IonContent>
    </>
  );
};

export default ProductAdd;
